data-barba=\"container\" data-barba-namespace=\"home\" class=\"l-body-wrapper\"><div\n			id=\"content-start\"\n			class=\"h-content-starting-point \"\n		></div><section class=\"o-i360-hero o-i360-hero--sample-page o-i360-hero--i360-regular o-i360-hero--color-default o-i360-hero--size-medium o-i360-hero--align-default o-i360-hero--info-container-size-medium js-parallax\"><div\n		class=\"o-i360-hero__img-wrapper o-i360-hero__img-wrapper--hero-bg-img a-img-wrapper   js-parallax__translate o-hero__img-wrapper--hero-bg-img\"\n		><img\n				\n							src=\"http://localhost/wp-content/uploads/2021/12/hero_family.png\"\n		\n							srcset=\"http://localhost/wp-content/uploads/2021/12/hero_family.png 1064w, http://localhost/wp-content/uploads/2021/12/hero_family-300x141.png 300w, http://localhost/wp-content/uploads/2021/12/hero_family-1024x481.png 1024w, http://localhost/wp-content/uploads/2021/12/hero_family-768x361.png 768w\"\n		\n				\n		class=\"   a-img--srcset o-i360-hero__img o-i360-hero__img--hero-bg-img a-img \"\n	/></div><span class=\"o-i360-hero__gradient\" style=\"background:linear-gradient(-90deg,#f4f8f800 35%, #f4f8f880 50%, #f4f8f8f8 75%)\"></span><div class=\"o-i360-hero__content l-container\"><div class=\"o-i360-hero__info-wrapper\"><div class=\" o-i360-hero__title-wrapper \"><h1 class=\" o-i360-hero__title  a-title      \"><span style=\"color: #18b1a9;\">A health plan</span> that cares as much as you do\n\n			</h1></div><div\n            class=\" a-subtitle o-i360-hero__subtitle  a-content\"\n        ><p>Wouldn’t it be nice if your healthcare worked as hard as you?<br />\nTo protect employee wellness and productivity? To cut complexity,<br />\nclutter and costs? To improve member experience – and yours too?</p></div></div></div></section><div\n		class=\"\n		o-dbm\n		o-i360-image-text\n		o-i360-image-text--container-img-left\n		o-dbm--align-default\n		o-dbm--padding-bottom-default\n		o-dbm--padding-top-default\n		o-dbm--bg-color\n		o-dbm--color-default\n		\"\n		id=\"\"\n	><div class=\"m-background-set o-dbm__bg o-i360-image-text__bg-set  absolute inset-0 w-full h-full\"></div><div class=\"l-container o-i360-image-text__container\"><div class=\"o-i360-image-text__content-wrapper o-i360-image-text__content-wrapper--img-left\"><div class=\"o-i360-image-text__group-text\"><div class=\"o-dbm__title-wrapper o-i360-image-text__title-wrapper \"><h2 class=\"o-dbm__title o-i360-image-text__title wow a-title a-title--style-default   a-title--small  \">\n				Imagine360 <span style=\"color: #18b1a9;\">understands</span></h2></div><div\n			class=\"o-dbm__content o-i360-image-text__content a-content a-content--default wow \"\n		><p><strong>We developed a self-funded health plan that’s fixing today’s one-size-fits-none PPO insurance problems with powerful, customized solutions.</strong></p><p>We take a different approach: putting control back in your hands and providing access to higher-quality care. For you, your employees and their families. With deep savings. And unwavering support. Imagine that.</p></div><div class=\" o-i360-image-text__button-wrapper  wow\"><a\n			class=\"o-i360-image-text__btn   a-link a-link--underline\"\n			href=\"#\"\n			target=\"_self\"\n		>\n			Explore our solutions\n\n								</a></div></div><div class=\"o-i360-image-text__group-img\"><!-- Crop image --><div\n		class=\"o-i360-image-text__img-wrapper o-i360-image-text__img-wrapper--single a-img-wrapper wow  \"\n		><img\n				\n							data-src=\"http://localhost/wp-content/uploads/2021/11/img_health.png.png\"\n		\n				\n				\n		class=\"  a-img--lazyload lazyload h-lazyload  o-i360-image-text__img o-i360-image-text__img--single a-img \"\n	/></div></div></div></div></div><div\n		class=\"\n		o-dbm\n		o-i360-text\n		o-i360-text--default\n		o-dbm--align-default\n		o-dbm--padding-bottom-sm\n		o-dbm--padding-top-none\n		o-dbm--bg-color\n		o-dbm--color-default\n		\"\n		id=\"\"\n	><div class=\"m-background-set o-dbm__bg o-i360-text__bg-set  absolute inset-0 w-full h-full\"></div><div class=\"l-container o-i360-text__container\" ><div class=\"o-dbm__title-wrapper o-i360-text__title-wrapper \"><h3 class=\"o-dbm__title o-i360-text__title wow a-title a-title--style-default a-title--small    \">\n				The healthcare dilemma\n\n			</h3></div><div\n			class=\"o-dbm__content o-i360-text__content a-content a-content--default wow \"\n		><p class=\"p1\">When it comes to healthcare, it’s getting harder and harder to do the right thing by your employees at the right price for your business. Each year, you face the daunting task of slicing and dicing options, trying to avoid that “spend more, get less” feeling.</p></div></div></div><div\n		class=\"\n		o-dbm\n		o-i360-comparison-table\n		o-i360-comparison-table--default\n		o-dbm--align-default\n		o-dbm--padding-bottom-default\n		o-dbm--padding-top-none\n		o-dbm--bg-color\n		o-dbm--color-default\n		\"\n		id=\"\"\n	><div class=\"m-background-set o-dbm__bg o-i360-comparison-table__bg-set  absolute inset-0 w-full h-full\"></div><div class=\"l-container o-i360-comparison-table__container\"><div class=\"o-i360-comparison-table__cards-wrapper\"><div class=\"m-list-simple o-i360-comparison-table__list-simple m-list-simple--default wow  o-i360-comparison-table__list--cons\"><span class=\"m-list-simple__bg absolute top-0 right-0 bottom-0 w-full h-full\"></span><div class=\" m-list-simple__title-wrapper \"><h4 class=\" m-list-simple__title  a-title      \">\n				Others give you:\n			</h4></div><ul class=\"m-list-simple__list\"><li class=\"m-list-simple__list-item m-list-simple__list-item--1\"><div class=\'m-list-simple__list-item-inner m-list-simple__list-item-inner--1\'><span class=\"m-list-simple__list-icon\"><svg xmlns=\"http://www.w3.org/2000/svg\" width=\"31\" height=\"31\" viewBox=\"0 0 31 31\"><g><g><path fill=\"red\" fill-opacity=\".5\" d=\"M20 17.855c.269.282.429.665.429 1.065 0 .4-.16.783-.429 1.08-.297.269-.68.429-1.08.429s-.783-.16-1.065-.429l-1.935-2L14 20c-.297.269-.68.429-1.08.429s-.783-.16-1.0