      &quot;&gt;&lt;span style=&quot;color: #18b1a9;&quot;&gt;A health plan&lt;/span&gt; that cares as much as you do\n\n			&lt;/h1&gt;&lt;/div&gt;&lt;div\n            class=&quot; a-subtitle o-i360-hero__subtitle  a-content&quot;\n        &gt;&lt;p&gt;Wouldn&rsquo;t it be nice if your healthcare worked as hard as you?&lt;br /&gt;\nTo protect employee wellness and productivity? To cut complexity,&lt;br /&gt;\nclutter and costs? To improve member experience &ndash; and yours too?&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/section&gt;&lt;div\n		class=&quot;\n		o-dbm\n		o-i360-image-text\n		o-i360-image-text--container-img-left\n		o-dbm--align-default\n		o-dbm--padding-bottom-default\n		o-dbm--padding-top-default\n		o-dbm--bg-color\n		o-dbm--color-default\n		&quot;\n		id=&quot;&quot;\n	&gt;&lt;div class=&quot;m-background-set o-dbm__bg o-i360-image-text__bg-set  absolute inset-0 w-full h-full&quot;&gt;&lt;/div&gt;&lt;div class=&quot;l-container o-i360-image-text__container&quot;&gt;&lt;div class=&quot;o-i360-image-text__content-wrapper o-i360-image-text__content-wrapper--img-left&quot;&gt;&lt;div class=&quot;o-i360-image-text__group-text&quot;&gt;&lt;div class=&quot;o-dbm__title-wrapper o-i360-image-text__title-wrapper &quot;&gt;&lt;h2 class=&quot;o-dbm__title o-i360-image-text__title wow a-title a-title--style-default   a-title--small  &quot;&gt;\n				Imagine360 &lt;span style=&quot;color: #18b1a9;&quot;&gt;understands&lt;/span&gt;&lt;/h2&gt;&lt;/div&gt;&lt;div\n			class=&quot;o-dbm__content o-i360-image-text__content a-content a-content--default wow &quot;\n		&gt;&lt;p&gt;&lt;strong&gt;We developed a self-funded health plan that&rsquo;s fixing today&rsquo;s one-size-fits-none PPO insurance problems with powerful, customized solutions.&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;We take a different approach: putting control back in your hands and providing access to higher-quality care. For you, your employees and their families. With deep savings. And unwavering support. Imagine that.&lt;/p&gt;&lt;/div&gt;&lt;div class=&quot; o-i360-image-text__button-wrapper  wow&quot;&gt;&lt;a\n			class=&quot;o-i360-image-text__btn   a-link a-link--underline&quot;\n			href=&quot;#&quot;\n			target=&quot;_self&quot;\n		&gt;\n			Explore our solutions\n\n								&lt;/a&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=&quot;o-i360-image-text__group-img&quot;&gt;&lt;!-- Crop image --&gt;&lt;div\n		class=&quot;o-i360-image-text__img-wrapper o-i360-image-text__img-wrapper--single a-img-wrapper wow  &quot;\n		&gt;&lt;img\n				\n							data-src=&quot;http://localhost/wp-content/uploads/2021/11/img_health.png.png&quot;\n		\n				\n				\n		class=&quot;  a-img--lazyload lazyload h-lazyload  o-i360-image-text__img o-i360-image-text__img--single a-img &quot;\n	/&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div\n		class=&quot;\n		o-dbm\n		o-i360-text\n		o-i360-text--default\n		o-dbm--align-default\n		o-dbm--padding-bottom-sm\n		o-dbm--padding-top-none\n		o-dbm--bg-color\n		o-dbm--color-default\n		&quot;\n		id=&quot;&quot;\n	&gt;&lt;div class=&quot;m-background-set o-dbm__bg o-i360-text__bg-set  absolute inset-0 w-full h-full&quot;&gt;&lt;/div&gt;&lt;div class=&quot;l-container o-i360-text__container&quot; &gt;&lt;div class=&quot;o-dbm__title-wrapper o-i360-text__title-wrapper &quot;&gt;&lt;h3 class=&quot;o-dbm__title o-i360-text__title wow a-title a-title--style-default a-title--small    &quot;&gt;\n				The healthcare dilemma\n\n			&lt;/h3&gt;&lt;/div&gt;&lt;div\n			class=&quot;o-dbm__content o-i360-text__content a-content a-content--default wow &quot;\n		&gt;&lt;p class=&quot;p1&quot;&gt;When it comes to healthcare, it&rsquo;s getting harder and harder to do the right thing by your employees at the right price for your business. Each year, you face the daunting task of slicing and dicing options, trying to avoid that &ldquo;spend more, get less&rdquo; feeling.&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div\n		class=&quot;\n		o-dbm\n		o-i360-