 from.\r\n\r\nBut by 2015, Classic Auto started seeing fewer and fewer health plan options in the marketplace. “We got down to only a handful and some of them wouldn’t bid us each year,” said Durant. “Our only way forward was to make the deductibles more and more unaffordable just to be able to offer healthcare benefits.”'),(4549,687,'_block_0_content','field_618c1454b7bf4'),(4550,687,'block_0_add_max_width','0'),(4551,687,'_block_0_add_max_width','field_618c1454b7bf5'),(4552,687,'block_0_add_button','0'),(4553,687,'_block_0_add_button','field_618c1454b7bf7'),(4554,687,'block_0_alignment','default'),(4555,687,'_block_0_alignment','field_618c1454b7bfa'),(4556,687,'block_0_version','alt-title-left'),(4557,687,'_block_0_version','field_618c1454b7bfc'),(4558,687,'block_0_block_id',''),(4559,687,'_block_0_block_id','field_618c1454b7bfe'),(4560,687,'block_0_block_visuals',''),(4561,687,'_block_0_block_visuals','field_618c1454b7c00'),(4594,687,'block_1_block_padding_top','default'),(4595,687,'_block_1_block_padding_top','field_5e438c8b47781'),(4596,687,'block_1_block_padding_bottom','default'),(4597,687,'_block_1_block_padding_bottom','field_5e438cb647782'),(4598,687,'block_1_block_text_color','default'),(4599,687,'_block_1_block_text_color','field_5e43241eda908'),(4600,687,'block_1_block_background_type','color'),(4601,687,'_block_1_block_background_type','field_5fd33b298c691'),(4602,687,'block_1_block_background_color','#074757'),(4603,687,'_block_1_block_background_color','field_5e4322e06f10e'),(4604,687,'block_1_block_border_top','none'),(4605,687,'_block_1_block_border_top','field_5faca17578630'),(4606,687,'block_1_block_border_bottom','none'),(4607,687,'_block_1_block_border_bottom','field_5faca1b278631'),(4630,687,'block_2_block_padding_top','default'),(4631,687,'_block_2_block_padding_top','field_5e438c8b47781'),(4632,687,'block_2_block_padding_bottom','default'),(4633,687,'_block_2_block_padding_bottom','field_5e438cb647782'),(4634,687,'block_2_block_text_color','