con_img','1151'),(5650,715,'_block_4_repeater_2_icon_img','field_61c20fd0bf117'),(5651,715,'block_4_repeater_3_icon_image','1'),(5652,715,'_block_4_repeater_3_icon_image','field_61c20f83bf116'),(5653,715,'block_4_repeater_3_icon_img','1152'),(5654,715,'_block_4_repeater_3_icon_img','field_61c20fd0bf117'),(5655,715,'block_4_repeater_4_icon_image','1'),(5656,715,'_block_4_repeater_4_icon_image','field_61c20f83bf116'),(5657,715,'block_4_repeater_4_icon_img','1153'),(5658,715,'_block_4_repeater_4_icon_img','field_61c20fd0bf117'),(5659,715,'block_4_repeater_5_icon_image','1'),(5660,715,'_block_4_repeater_5_icon_image','field_61c20f83bf116'),(5661,715,'block_4_repeater_5_icon_img','1154'),(5662,715,'_block_4_repeater_5_icon_img','field_61c20fd0bf117'),(5663,687,'block_2_block_title','Solution'),(5664,687,'_block_2_block_title','field_618c1454b7bf3_field_5d529a3695dc2'),(5665,687,'block_2_title_type','2'),(5666,687,'_block_2_title_type','field_618c1454b7bf3_field_5eac355441613'),(5667,687,'block_2_title_width','small'),(5668,687,'_block_2_title_width','field_618c1454b7bf3_field_5e4095d0ab66e'),(5669,687,'block_2_title_style','style-default'),(5670,687,'_block_2_title_style','field_618c1454b7bf3_field_61afa33a56167'),(5671,687,'block_2_content','Knowing they wouldn’t be able to survive with upward of 30% increases from the remaining big box carriers, Classic Auto Group dove into researching options for how to structure a health plan.\r\n\r\nDespite a healthy skepticism of RBP, one of its founding philosophies struck close-to-home for Durant: the best time to negotiate is before you buy.\r\n\r\nClassic Auto Group made the decision to become self-insured with an RBP solution, and expectations and enthusiasm were high when they chose their first RBP vendor.\r\n\r\nAccording to Durant, provider negotiations are an attractive element of some RBP solutions, but at the end of the day “the job didn’t get done” with the previous RBP provider. “The calls weren’t made, and the negotiations never happened, and the claims went unpaid and everyone was unhappy.”\r\n\r\nThat’s when Classic Auto knew they had to try out the solution they learned everyone else in the marketplace was using: ELAP Services.'),(5672,687,'_block_2_content','field_618c1454b7bf4'),(5673,687,'block_2_add_max_width','0'),(5674,687,'_block_2_add_max_width','field_618c1454b7bf5'),(5675,687,'block_2_add_button','0'),(5676,687,'_block_2_add_button','field_618c1454b7bf7'),(5677,687,'block_2_alignment','default'),(5678,687,'_block_2_alignment','field_618c1454b7bfa'),(5679,687,'block_2_version','alt-title-left'),(5680,687,'_block_2_version','field_618c1454b7bfc'),(5681,687,'block_2_block_id',''),(5682,687,'_block_2_block_id','field_618c1454b7bfe'),(5683,687,'block_2_block_visuals',''),(5684,687,'_block_2_block_visuals','field_618c1454b7c00'),(5685,687,'block_3_block_title','Results'),(5686,687,'_block_3_block_title','field_61afc52de5a35_field_5d529a3695dc2'),(5687,687,'block_3_title_type','2'),(5688,687,'_block_3_title_type','field_61afc52de5a35_field_5eac355441613'),(5689,687,'block_3_title_width','small'),(5690,687,'_block_3_title_width','field_61afc52de5a35_field_5e4095d0ab66e'),(5691,687,'block_3_title_style','style-default'),(5692,687,'_block_3_title_style','field_61afc52de5a35_field_61afa33a56167'),(5693,687,'block_3_content','<h5>Since moving to ELAP in 2020, Classic Auto has saved 31% in healthcare costs versus a fully insured plan. They’ve also kept their healthcare expenses flat for three years straight, a point Durant emphasized.</h5>\r\nClassic Auto’s employees now have out-of-pockets and deductibles that are “much more reasonable in today’s dollars.”\r\n\r\nDurant credits the added feature of easy access to provider partners with cutting deductibles in half. ELAP offers affordable quality care through direct partnerships with more than a dozen health systems across the nation, which employees greatly appreciate according to Durant.\r\n\r\n“They walk into a provider partner and everything goes smoothly from that point.”'),(5694,687,'_block_3_content','field_61afc52de5be5'),(5695,687,'block_3_repeater_0_title','$32M'),(5696,687,'_block_3_repeater_0_title','field_61afc52edf1de'),(5697,687,'block_3_repeater_0_content','Total savings using reference-based pricing'),(5698,687,'_block_3_repeater_0_content','field_61afc52edf270'),(5699,687,'block_3_repeater_1_title','$0/Year'),(5700,687,'_block_3_repeater_1_title','field_61afc52edf1de'),(5701,687,'block_3_repeater_1_content','Employee premium increases for three consecutive years'),(5702,687,'_block_3_repeater_1_content','field_61afc52edf270'),(5703,687,'block_3_repeater_2_title','50%'),(5704,687,'_block_3_repeater_2_title','field_61afc52edf1de'),(5705,687,'block_3_repeater_2_content','Lower out-out-pocket costs for provider partners'),(5706,687,'_block_3_repeater_2_content','field_61afc52edf270'),(5707,687,'block_3_repeater','3'),(5708,687,'_block_3_repeater','field_61afc52de5c33'),(5709,687,'block_3_add_button','0'),(5710,687,'_block_3_add_button','field_61afc52de5c9a'),(5711,687,'block_3_alignment','default'),(5712,687,'_block_3_alignment','field_61afc52de5dc0'),(5713,687,'block_3_version','default'),(5714,687,'_block_3_version','field_61afc52de5eeb'),(5715,687,'block_3_block_id',''),(5716,687,'_block_3_block_id','field_61afc52de6001'),(5717,687,'block_3_block_visuals',''),(5718,687,'_block_3_block_visuals','field_61afc52de6101'),(5719,687,'block_4_content','“We were promised all of the bells and whistles that came along with the ELAP program, including the concierge navigation services on the front and back ends, but with our prior carrier we were getting neither. That was why we moved over, for the lack of services,” explained Durant.\r\n\r\nNow, with ELAP’s care navigation, Classic Auto can structure their benefits so their members have someone available to help them make an informed decision that is financially beneficial for both the member and the dealership.\r\n\r\nELAP’s Client Relationship Management (CRM) team provides five-star support that helps the plan succeed, including active involvement with Classic Auto’s HR people. Perhaps Durant summed it up best with this comment:\r\n\r\n“It just seemed like y’all knew how to get it done. I don’t know if it was processes or expertise or relationships built over time, but y’all knew how to get it done, and you did.”'),(5720,687,'_block_4_content','field_618c1454b7bf4'),(5721,687,'block_4_add_max_width','0'),(5722,687,'_block_4_add_max_width','field_618c1454b7bf5'),(5723,687,'block_4_add_button','0'),(5724,687,'_block_4_add_button','field_618c1454b7bf7'),(5725,687,'block_4_alignment','default'),(5726,687,'_block_4_alignment','field_618c1454b7bfa'),(5727,687,'block_4_version','alt-title-left'),(5728,687,'_block_4_version','field_618c1454b7bfc'),(5729,687,'block_4_block_id',''),(5730,687,'_block_4_block_id','field_618c1454b7bfe'),(5731,687,'block_4_block_visuals',''),(5732,687,'_block_4_block_visuals','field_618c1454b7c00'),(5733,687,'block_5_block_title',''),(5734,687,'_block_5_block_title','field_5d529a3695dc2'),(5735,687,'block_5_title_type','2'),(5736,687,'_block_5_title_type','field_5eac355441613'),(5737,687,'block_5_title_width','small'),(5738,687,'_block_5_title_width','field_5e4095d0ab66e'),(5739,687,'block_5_title_style','style-default'),(5740,687,'_block_5_title_style','field_61afa33a56167'),(5741,687,'block_5_title',''),(5742,687,'_block_5_title','field_61c469b7b18ef'),(5743,687,'block_5_content','“We had the complaints, we had a year of experience, and when ELAP came in to present, I was convinced it was the most developed product out there,” said Durant.'),(5744,687,'_block_5_content','field_61c469b7b18f0'),(5745,687,'block_5_add_deco','1'),(5746,687,'_block_5_add_deco','field_61c469b7b18f1'),(5747,687,'block_5_add_button','0'),(5748,687,'_block_5_add_button','field_61c469b7b18f2'),(5755,687,'block_6_block_title','The bottom line'),(5756,687,'_block_6_block_title','field_618c1454b7bf3_