c583936'),(6380,688,'hide_the_hero_title','0'),(6381,688,'_hide_the_hero_title','field_5c8af4292d7a8'),(6382,688,'hero_title','MarineMax Charts its Course: <span style=\"color: #067e79;\">Full-Speed ahead on Savings</span>'),(6383,688,'_hero_title','field_5c5a2c5e7f730'),(6384,688,'hero_subtitle','<ul class=\"ul1\">\r\n 	<li class=\"li1\"><span class=\"s1\">World’s largest boat retailer</span></li>\r\n 	<li class=\"li1\"><span class=\"s1\">50 locations nationwide</span></li>\r\n 	<li class=\"li1\"><span class=\"s1\">1,600 full-time employees</span></li>\r\n</ul>'),(6385,688,'_hero_subtitle','field_5c5a2c6f7f731'),(6386,688,'hero_buttons',''),(6387,688,'_hero_buttons','field_5c5a294e9a6eb'),(6388,688,'block_0_block_pretitle','the challenge'),(6389,688,'_block_0_block_pretitle','field_61c2c4eb21150'),(6390,688,'block_0_block_title','MarineMax worked with the four largest group health insurance plans over several years prior to switching to a self-funded health plan.'),(6391,688,'_block_0_block_title','field_61b478ab958aa_field_5d529a3695dc2'),(6392,688,'block_0_title_type','3'),(6393,688,'_block_0_title_type','field_61b478ab958aa_field_5eac355441613'),(6394,688,'block_0_title_width','small'),(6395,688,'_block_0_title_width','field_61b478ab958aa_field_5e4095d0ab66e'),(6396,688,'block_0_title_style','style-default'),(6397,688,'_block_0_title_style','field_61b478ab958aa_field_61afa33a56167'),(6398,688,'block_0_content','They had a long list of frustrations, but ultimately it was the lack of transparency and access to their plan utilization details combined with the unnecessary spending that prompted their move to self-insurance with a reference-based pricing (RBP) solution.\r\n<blockquote>“In those days, I used to go into pre-enrollment meetings every year and pray for a single-digit increase in costs, hoping our employees wouldn’t have too much to bear.”<strong>Ray Bowman, Ph.D., Senior Vice President of Talent and Team Development</strong></blockquote>\r\nA $9,000 processing error on a personal healthcare claim highlighted the expensive and variable reimbursement ranges allowed by his PPO health plan. When Dr. Bowman investigated further, he was shocked to learn that the PPO “allowable” range for his $900 medical procedure topped out over $20,000.\r\n\r\n“The experience taught me that the large insurance companies are paying no attention and are just writing checks. That was the straw that broke the camel’s back and led me on my journey for a viable alternative for MarineMax.”'),(6399,688,'_block_0_content','field_61b478ab958ab'),(6400,688,'block_0_image','1194'),(6401,688,'_block_0_image','field_61b478ab958ac'),(6402,688,'block_0_author_name','Ray Bowman'),(6403,688,'_block_0_author_name','field_61c47f594cdeb'),(6404,688,'block_0_author_short_description','Ph.D., Senior Vice President of Talent and Team Development'),(6405,688,'_block_0_author_short_description','field_61c47f8a4cded'),(6406,688,'block_0_add_button','0'),(6407,688,'_block_0_add_button','field_61b478ab958ae'),(6408,688,'block_0_alignment','default'),(6409,688,'_block_0_alignment','field_61b478ab958b1'),(6410,688,'block_0_version','staff-right'),(6411,688,'_block_0_version','field_61b478ab958b3'),(6412,688,'block_0_block_id',''),(6413,688,'_block_0_block_id','field_61b478ab958b5'),(6414,688,'block_0_block_padding_top','default'),(6415,688,'_block_0_block_padding_top','field_5e438c8b47781'),(6416,688,'block_0_block_padding_bottom','default'),(6417,688,'_block_0_block_padding_bottom','field_5e438cb647782'),(6418,688,'block_0_block_text_color','default'),(6419,688,'_block_0_block_text_color','field_5e43241eda908'),(6420,688,'block_0_block_background_type','color'),(6421,688,'_block_0_block_background_type','field_5fd33b298c691'),(6422,688,'block_0_block_background_color',''),(6423,688,'_block_0_block_background_color','field_5e4322e06f10e'),(6424,688,'block_0_block_border_top','none'),(6425,688,'_block_0_block_border_top','field_5faca17578630'),(6426,688,'block_0_bloc