'title_style','style-default'),(7257,1209,'_title_style','field_61afa33a56167'),(7258,1209,'title',''),(7259,1209,'_title','field_61979897e2227'),(7260,1209,'quote_content','Imagine360 has an active and vibrant council to promote and support diversity and inclusion within our organization and beyond to our communities.\r\n<h5 class=\"p1\"><span class=\"s1\" style=\"color: #074757;\"><b>Our Inclusion, Diversity, Equity, Action (IDEA) Council Mission Statement:</b></span></h5>\r\n<p class=\"p1\"><span class=\"s1\">To enhance diversity, inclusion, equality and understanding within the organization, promoting dialogue, providing information, serving our communities and fostering respect for all associates.</span></p>'),(7261,1209,'_quote_content','field_61979927beec8'),(7262,1209,'add_button','0'),(7263,1209,'_add_button','field_5fc8aff19b5f7'),(7264,1209,'background_type','image'),(7265,1209,'_background_type','field_5fd0d72396016'),(7266,1209,'background_image','1210'),(7267,1209,'_background_image','field_5fd0d77a96018'),(7268,1209,'background_image_mobile',''),(7269,1209,'_background_image_mobile','field_619fb53ff753f'),(7270,1209,'add_overlay','0'),(7271,1209,'_add_overlay','field_5fd0d80a96019'),(7272,1209,'add_gradient','0'),(7273,1209,'_add_gradient','field_6197f1ec482cb'),(7274,1209,'text_color','default'),(7275,1209,'_text_color','field_5fd0d9db9601c'),(7276,1209,'alignment','default'),(7277,1209,'_alignment','field_5fe05a39dd2ea'),(7278,714,'set_aside_image','0'),(7279,714,'_set_aside_image','field_5eaafca1a80f2'),(7280,714,'block_2_relationship','a:1:{i:0;s:4:\"1209\";}'),(7281,714,'_block_2_relationship','field_6194923c3da0d'),(7282,714,'block_2_block_id',''),(7283,714,'_block_2_block_id','field_6194923c3da0f'),(7284,714,'block_3_block_pretitle','Inclusivity is a priority'),(7285,714,'_block_3_block_pretitle','field_61c2c42921941'),(7286,714,'block_3_block_title','We’re an <span style=\"color: #18b1a9;\">equal opportunity employer</span>'),(7287,714,'_block_3_block_title','field_618c1454b7bf3_field_5d529a3695dc2'),(7288,714,'block_3_title_type','2'),(7289,714,'_block_3_title_type','field_618c1454b7bf3_field_5eac355441613'),(7290,714,'block_3_title_width','wide'),(7291,714,'_block_3_title_width','field_618c1454b7bf3_field_5e4095d0ab66e'),(7292,714,'block_3_title_style','style-default'),(7293,714,'_block_3_title_style','field_618c1454b7bf3_field_61afa33a56167'),(7294,714,'block_3_content','Our company vision is based on a revolutionary idea: To deliver high-quality healthcare, at a fair price, for every employee of every self-insured company. The same vision that drives our business translates to our hiring practices and defines who we are.\r\n\r\nWe’re committed to providing equal opportunities and building a team that represents a variety of backgrounds, perspectives and skills. The more inclusive we are, the better our work will be. We recruit, employ, train, compensate and promote all qualified individuals regardless of race, ethnicity, religion, color, sex, gender, gender identity, disability, age, national origin, sexual orientation, marital status, health status, veteran status and all other legally protected characteristics.'),(7295,714,'_block_3_content','field_618c1454b7bf4'),(7296,714,'block_3_add_max_width','0'),(7297,714,'_block_3_add_max_width','field_618c1454b7bf5'),(7298,714,'block_3_add_button','1'),(7299,714,'_block_3_add_button','field_618c1454b7bf7'),(7300,714,'block_3_style','a-btn a-btn--primary'),(7301,714,'_block_3_style','field_58862e48827ba'),(7302,714,'block_3_link','a:3:{s:5:\"title\";s:16:\"See job openings\";s:3:\"url\";s:43:\"http://localhost/careers/\";s:6:\"target\";s:0:\"\";}'),(7303,714,'_block_3_link','field_58090b4741841'),(7304,714,'block_3_button',''),(7305,714,'_block_3_button','field_618c1454b7bf8'),(7306,714,'block_3_alignment','default'),(7307,714,'_block_3_alignment','field_618c1454b7bfa'),(7308,714,'block_3_version','default'),(7309,714,'_block_3_version','field_618c1454b7bfc