id\";s:0:\"\";}s:13:\"default_value\";s:0:\"\";s:11:\"placeholder\";s:0:\"\";s:7:\"prepend\";s:0:\"\";s:6:\"append\";s:0:\"\";s:9:\"maxlength\";s:0:\"\";}','Title','title','publish','closed','closed','','field_61afc53417c6e','','','2021-12-07 20:40:23','2021-12-07 20:40:23','',1082,'http://localhost/?post_type=acf-field&p=1083',0,'acf-field','',0),(1084,1,'2021-12-07 20:40:23','2021-12-07 20:40:23','a:10:{s:4:\"type\";s:7:\"wysiwyg\";s:12:\"instructions\";s:0:\"\";s:8:\"required\";i:0;s:17:\"conditional_logic\";b:0;s:7:\"wrapper\";a:3:{s:5:\"width\";s:0:\"\";s:5:\"class\";s:0:\"\";s:2:\"id\";s:0:\"\";}s:4:\"tabs\";s:3:\"all\";s:7:\"toolbar\";s:4:\"full\";s:12:\"media_upload\";i:1;s:13:\"default_value\";s:0:\"\";s:5:\"delay\";i:0;}','Content','content','publish','closed','closed','','field_61afc53417cb2','','','2021-12-07 20:40:23','2021-12-07 20:40:23','',1082,'http://localhost/?post_type=acf-field&p=1084',1,'acf-field','',0),(1085,1,'2021-12-07 20:41:38','2021-12-07 20:41:38','','Reference Based Pricing','','publish','closed','closed','','reference-based-pricing','','','2021-12-28 13:44:27','2021-12-28 13:44:27','',0,'http://localhost/?page_id=1085',0,'page','',0),(1086,1,'2021-12-07 22:13:36','2021-12-07 22:13:36','Brian brings more than 20 years of experience in the healthcare industry to his role at Imagine360, particularly in the areas of cost containment, PPO network management, and disease management.\r\n\r\nAmong his previous positions were a chief operating officer of ELAP Services, president of Devon Health Services, founder and CEO of Solutionary Health, and senior vice president at MultiPlan. \r\n\r\nBrian received his undergraduate degree from Villanova University and an MBA from the Wharton School of the University of Pennsylvania.\r\n','Brian Atkinson','','publish','closed','closed','','brian-atkinson','','','2021-12-23 20:49:17','2021-12-23 20:49:17','',0,'http://localhost/?post_type=staff&#038;p=1086',0,'staff','',0),(1087,1,'2021-12-07 22:15:09','2021-12-07 22:15:09','Jeff has three decades of experience in managing and growing healthcare services companies. Before joining Imagine360, he was at ELAP Services, where he worked closely with CEO and co-founder Steve Kelly to spearhead the company’s continued expansion to reduce health insurance costs on behalf of U.S. employers.\r\n\r\nJeff also served as global practice leader of the Health, Life Sciences and Business Process Outsourcing (BPO) division for Wipro Limited. He was also president and CEO of HealthPlan Holdings before its acquisition by Wipro. HPH was a leading healthcare solutions business serving payers, self-funded employers, unions, small businesses and individuals.\r\n\r\nJeff holds a business degree from Clemson University, with continued education from the Wharton School of Business at the University of Pennsylvania and the Kellogg School of Management at Northwestern University.','Jeff Bak','','publish','closed','closed','','jeff-bak','','','2021-12-27 20:18:45','2021-12-27 20:18:45','',0,'http://localhost/?post_type=staff&#038;p=1087',1,'staff','',0),(1088,1,'2021-12-07 22:15:46','2021-12-07 22:15:46','Mike has more than 35 years of international finance experience, with particular expertise in consolidating and strengthening high-growth, private equity-backed businesses and newly integrated organizations. The skills he brings to Imagine360 include those required for mergers and acquisitions, financial planning and analysis, financial reporting and cost management.\r\n\r\nHe was previously CFO and executive vice president of Physicians’ Desk Reference (PDR), CFO for MediMedia USA and held leadership positions at IMS International in London.\r\n\r\nMike holds a bachelor of science degree from the University of Bradford in England.\r\n','Mike Burnett','','publish','closed','closed','','mike-burnett','','','2021-12-23 20:53:32','2021-12-23 20:53:32','',0,'http://localhost/?post_type=staff&#038;p=1088',2,'staff','',0),(1089,1,'2021-12-07 22:16:48','2021-12-07 22:16:48','Chris brings a wealth of experience from across the fields of population health management and benefits strategy and delivery. Prior to his position at Imagine360, he was CEO of Imagine Health and president of Healthways – building the company’s employer and government division. He also led its people and culture strategies as its chief HR officer.\r\n\r\nChris has received multiple honors from the National Business Group on Health and, during his tenure, Healthways was listed on Fortune’s “Best Places to Work.” He holds a bachelor’s degree from Bucknell University and a master’s degree from Pepperdine University.\r\n','Chris Cigarran','','publish','closed','closed','','chris-cigarran','','','2021-12-23 20:54:28','2021-12-23 20:54:28','',0,'http://localhost/?post_type=staff&#038;p=1089',3,'staff','',0),(1090,1,'2021-12-07 22:17:53','2021-12-07 22:17:53','Eileen brings more than 25 years of experience in human resources, employment law and consulting to her position at Imagine360. Leading all HR functions, she supports the company’s extraordinary growth by focusing on attracting and retaining an engaged and high-performing team. Among her successful efforts are a comprehensive total awards program, an innovative talent acquisition strategy, and a leadership and high-potentials development program. In 2019, Eileen’s team was recognized as the HR Department of the Year for the Philadelphia metropolitan area.\r\n\r\nPrior to joining Imagine360, she was responsible for leading the strategic and tactical growth of the HR client services division of PROXUS.\r\n\r\nEileen earned a degree in business administration from Drexel University and a Juris Doctorate from Villanova University’s School of Law.\r\n','Eilleen Clark','','publish','closed','closed','','eilleen-clark','','','2021-12-23 20:55:33','2021-12-23 20:55:33','',0,'http://localhost/?post_type=staff&#038;p=1090',4,'staff','',0),(1091,1,'2021-12-07 22:18:20','2021-12-07 22:18:20','A veteran in the health insurance industry, Kathy brings extensive experience to Imagine360 in program and contract development, administration, budget planning, marketing and technology. She was previously the CEO at GPA, where she also served as executive vice president and as vice president of administration and marketing. \r\n\r\nKathy has served on the board of directors of the Texas Professional Benefit Administrators Association and was its president in 2000. She is also a board member of the Society of Professional Benefit Administrators and a member of the Self Insurance Institute of America. \r\n','Kathy Enochs','','publish','closed','closed','','kathy-enochs','','','2021-12-23 20:21:27','2021-12-23 20:21:27','',0,'http://localhost/?post_type=staff&#038;p=1091',5,'staff','',0),(1092,1,'2021-12-07 22:18:47','2021-12-07 22:18:47','Steve joined Imagine360 after co-founding ELAP Services in 2003 to address the challenges of employers who are burdened with skyrocketing healthcare costs. He has dedicated his career to solving those complex challenges and is a recognized expert in the insurance, employee benefits and risk management industry. He has been featured in multiple local and national media outlets, including NPR, The New York Times, Newsweek, Fox Business and Money magazine.\r\n\r\nIn 2019, Steve was chosen by Ernst & Young as the EY Entrepreneur of the Year in the Greater Philadelphia area. He was a national finalist in the financial services category.\r\n','Steve Kelly','','publish','closed','closed','','steve-kelly','','','2021-12-23 20:57:37','2021-12-23 20:57:37','',0,'http://localhost/?post_type=staff&#038;p=1092',6,'staff','',0),(1093,1,'2021-12-07 22:20:07','2021-12-07 22:20:07','In her current position, Katie is responsible for identifying and evaluating opportunities for innovative growth at Imagine360. She also is charged with developing impactful, market-changing solutions and facilitating how those offerings are brought to the market.\r\n\r\nShe previously was at ELAP Services, where she served as chief of staff, senior director of strategic initiatives and senior director of client and member services. She was also controller at Energy Plus, where she established an accounting and financial reporting function to address the demands of a startup that enjoyed consistent annual growth of more than 100%. It was later acquired by NRG Energy, Inc., where Katie served as senior director of retail integration management.\r\n\r\nKatie earned her degree in accounting and international business from Pennsylvania State University.\r\n','Katie O\'Leary','','publish','closed','closed','','katie-oleary','','','2021-12-23 20:58:40','2021-12-23 20:58:40','',0,'http://localhost/?post_type=staff&#038;p=1093',7,'staff','',0),(1094,1,'2021-12-07 22:20:52','2021-12-07 22:20:52','As Imagine360’s chief counsel, Troy oversees the company’s litigation strategy throughout the United States. He also advises the company on the healthcare and ERISA matters that impact its business and works with various trade organizations relating to targeted government relations initiatives.\r\n\r\nPrior to joining Imagine360, Troy was an accomplished trial attorney practicing civil litigation in the areas of dangerous prescription drugs, defective medical devices, occupational exposure claims and catastrophic workers’ compensation subrogation matters.\r\n\r\nTroy graduated cum laude from La Salle University and earned his Juris Doctorate from Widener University School of Law. He is admitted to practice law in Pennsylvania and New Jersey, as well as several federal courts throughout the United States.','Troy Sisum','','publish','closed','closed','','troy-sisum','','','2021-12-23 20:59:37','2021-12-23 20:59:37','',0,'http://localhost/?post_type=staff&#038;p=1094',8,'staff','',0),(1095,1,'2021-12-07 22:21:33','2021-12-07 22:21:33','James spearheaded transformational changes at EBMS and other healthcare companies before joining Imagine360. As EBMS chief information officer, he guided significant upgrades to its technology infrastructure, allowing it to better serve members and evolve into a fully integrated healthcare-management company with a national presence. He was named chief executive officer in 2019.\r\n\r\nJames has also held leadership positions at MetLife, Lehman Brothers, CareSource and HealthPlan Services.\r\n\r\nHe received a bachelor’s degree in computer information systems from Medaille College in Buffalo, N.Y.\r\n','James Vertino','','publish','closed','closed','','james-vertino','','','2021-12-23 20:25:24','2021-12-23 20:25:24','',0,'http://localhost/?post_type=staff&#038;p=1095',9,'staff','',0),(1096,1,'2021-12-07 22:23:31','2021-12-07 22:23:31','','Your Health Plan','','publish','closed','closed','','your-health-plan','','','2021-12-27 16:04:00','2021-12-27 16:04:00','',0,'http://localhost/?page_id=1096',0,'page','',0),(1097,1,'2021-12-07 22:22:17','2021-12-07 22:22:17','Woody, along with Steve Kelly, co-founded ELAP Services in 2003. He brings expertise to Imagine360 in healthcare, insurance, liability compliance and risk management is key to his consultations with employers, advisers and health plan administrators across the United States.\r\n\r\nWoody’s past experience includes nearly a decade in property and casualty insurance at a Top 5 brokerage and the designation of chartered property/casualty underwriter (CPCU). \r\n\r\nA native of Georgia, Woody earned a degree in risk management and insurance and an MBA in marketing from the University of Georgia.\r\n','Woody Waters','','publish','closed','closed','','woody-waters','','','2021-12-23 21:01:30','2021-12-23 21:01:30','',0,'http://localhost/?post_type=staff&#038;p=1097',10,'staff','',0),(1098,1,'2021-12-07 22:29:44','2021-12-07 22:29:44','','URAC - Disease Management','','publish','closed','closed','','urac-disease-management','','','2021-12-07 22:29:44','2021-12-07 22:29:44','',0,'http://localhost/?post_type=badge&#038;p=1098',0,'badge','',